            UPDATE public.distrito SET nome_simplificado = TRIM(UPPER(UNACCENT(relatorio.get_texto_sem_caracter_especial(distrito.nome))));
            CREATE INDEX distrito_tmp_nome_simplificado ON public.distrito(nome_simplificado);

            UPDATE public.distrito
            SET cod_ibge = tmp_cod_ibge_distrito.cod_ibge
            FROM public.tmp_cod_ibge_distrito,
            public.municipio
            WHERE municipio.idmun = distrito.idmun
            AND municipio.nome_simplificado = tmp_cod_ibge_distrito.nome_municipio
            AND distrito.nome_simplificado = tmp_cod_ibge_distrito.nome_distrito;

            INSERT INTO public.distrito
            (idmun, iddis, nome, cod_ibge, origem_gravacao, idpes_cad, data_cad, operacao, idsis_cad)
            SELECT
            municipio.idmun,
            (SELECT MAX(iddis) FROM public.distrito)+ row_number() OVER (),
            tmp_cod_ibge_distrito.nome_distrito_original, tmp_cod_ibge_distrito.cod_ibge, 'M', 1, NOW(), 'I', 9
            FROM tmp_cod_ibge_distrito
            JOIN public.municipio ON municipio.nome_simplificado = tmp_cod_ibge_distrito.nome_municipio
            LEFT JOIN public.distrito ON distrito.nome_simplificado = tmp_cod_ibge_distrito.nome_distrito
            AND municipio.idmun = distrito.idmun
            WHERE distrito.iddis IS NULL;

            SELECT setval('public.seq_distrito'::text::regclass, (SELECT MAX(iddis)+1 FROM public.distrito)::bigint);

